import React, { useEffect, useState } from 'react'
import Card from '../listing/Card';
const CarCategory = () => {
    const [carData, setCarData] = useState([]);
    useEffect(() => {
        const fetchData = async () => {
            try {
                const res = await fetch("http://localhost:5000/api/car/sell-car");
                const apiCars = await res.json();
                setCarData(apiCars);
            }
            catch (err) {
                console.log(err)
            }
        }
        fetchData();
    }, []);

    return (
        <div className='py-14'>
            <h2 className='text-xl font-semibold text-black/80 mb-4'>Used Cars By Body Type</h2>
            {/* cards */}
            <div>
                {
                    carData.slice(0, 8).map((data, index) => {
                        <Card key={index} data={data}/>
                    })
                }
            </div>
        </div>
    )
}

export default CarCategory
